import Realm from "realm";
 class Wards extends Realm.Object {}
  Wards.schema ={
    name: "Wards",
    properties :{
        WARDS_ID :'int?',
        WARDS_NAME: 'string',
        DISTRICT_ID: 'int?',
        LOCATION_CODE: 'int?'
    }
 }
  
 export default new Realm({schema:[Wards]})
